import { LOGIN_REQUEST } from './auth.types'
import axios from '../../helpers/axios'

export const login = (user) => async (dispatch) => {
  try {
    console.log(email, password)
    dispatch({
      type: LOGIN_REQUEST,
      payload: { user },
    })
    await axios.post('/admin/signin', { email, password })
  } catch (err) {
    console.log(err)
  }
}
